exports=async function(url){const webviewFetch=require("webview_fetch"),html=await webviewFetch(url);let fragment=html.substring(html.indexOf("class=\"comic-contain\""));fragment=fragment.substring(0,fragment.indexOf("</ul>"));const URL=require("url"),uri=new URL(url),urls=fragment.subRegexAll(/<img [^>]*src="([^"]+)"/g).map(_=>uri.resolve(_));return {urls}};